import React from 'react';
import SignIn from './../signIn/signIn'
import './signInPage.scss';
import SignUp from '../signUp/signUp';

const SignInPage = () => {
  return (
    <div className='signIn'>
      <SignIn />
      <SignUp />
    </div>
  )
}

export default SignInPage;
